// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
// pragma experimental ABIEncoderV2;
// cc bin u vo v u ra khng nn s dng tin t _, u ra 1 bin th k cn to tn bin, >= 2 bin th nn to tn bin
    // c th khng to tn bin  tit kim dung lng
// cc mng tham s u vo v u ra s dng "memory" ch khng s dng "calldata" v c gii hn dung lng
// connex v1: u vo khng h tr Tuple v Tuple[], u ra khng h tr Tuple v Tuple[], call trc tip t bin public th h tr Tuple
// connex v2: u vo khng h tr Tuple v Tuple[] ->  bo co vi vechain
// u vo cn h tr connex v1,v2, u ra c th khng cn h tr v1 nu call thng qua server
// VeChain h tr clauses nn khng cn dng Tuple cho u vo, mt clauses b reverted th c giao dch  b reverted
// address(0) khng th l contract nn lm a ch Payment cho native token c

/*
// import "https://github.com/tv-truong/openzeppelin-contracts-4.3.2/contracts/utils/Context.sol"; // @ c import trong Ownable, Pausable
// import "https://github.com/tv-truong/openzeppelin-contracts-4.3.2/contracts/utils/Address.sol"; // nhiu trng hp khng s dng nn lng ph gas
// import "https://github.com/tv-truong/openzeppelin-contracts-4.3.2/contracts/utils/math/SafeMath.sol"; // @ solidity >= 0.8.0 khng cn dng
import "https://github.com/tv-truong/openzeppelin-contracts-4.3.2/contracts/utils/structs/EnumerableSet.sol"; // @
import "https://github.com/tv-truong/openzeppelin-contracts-4.3.2/contracts/access/Ownable.sol"; // @ [import: Context]
import "https://github.com/tv-truong/openzeppelin-contracts-4.3.2/contracts/security/Pausable.sol"; // @ [import: Context]
    // Pausable.sol: nu s dng th cn gi _pause() v _unpause()
import "https://github.com/tv-truong/openzeppelin-contracts-4.3.2/contracts/security/ReentrancyGuard.sol";
    // ReentrancyGuard.sol: s dng khi gi n contract khng phi do mnh trin khai, multiple clauses vn h tr
*/
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

// openzeppelin-contracts/v4.3.2
interface IERC20 {
    // event Transfer(address indexed from, address indexed to, uint256 value);
    // event Approval(address indexed owner, address indexed spender, uint256 value);
    // function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address recipient, uint256 amount) external returns (bool);
    // function allowance(address owner, address spender) external view returns (uint256);
    // function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    // function permit(address owner, address spender, uint256 value, uint256 deadline, uint8 v, bytes32 r, bytes32 s) external; VPU
}

// openzeppelin-contracts/v4.3.2
interface IERC721 {
    // event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);
    // event Approval(address indexed owner, address indexed approved, uint256 indexed tokenId);
    // event ApprovalForAll(address indexed owner, address indexed operator, bool approved);
    // function balanceOf(address owner) external view returns (uint256 balance);
    function ownerOf(uint256 tokenId) external view returns (address owner);
    // function safeTransferFrom(address from, address to, uint256 tokenId) external;
    function transferFrom(address from, address to, uint256 tokenId) external;
    // function approve(address to, uint256 tokenId) external;
    function getApproved(uint256 tokenId) external view returns (address operator);
    // function setApprovalForAll(address operator, bool _approved) external;
    function isApprovedForAll(address owner, address operator) external view returns (bool);
    // function safeTransferFrom(address from, address to, uint256 tokenId, bytes calldata data) external;
    function supportsInterface(bytes4 interfaceId) external view returns (bool);
}
//---------------------------------

// ERC721BidV1
contract ERC721BidV1 is Ownable, Pausable, ReentrancyGuard {
    // using SafeMath for uint256; @ solidity >= 0.8.0 khng cn dng
    // using Address for address;  gi isContract(), khng dng  tit kim dung lng
    using EnumerableSet for EnumerableSet.UintSet;
    using EnumerableSet for EnumerableSet.AddressSet;

// Erc721 ------------------------------
    struct Erc721Info {
        bool enable; // cho php placeBid
        uint256 feeRate; // ph ngi bn phi tr: 1000 <=> 1%, nu feeRate > 0 th s dng feeRate thay cho Payment>feeRate
    }
    // erc721 address => Erc721Info
    mapping(address => Erc721Info) public supportedErc721Map;
// end Erc721 ------------------------------

// Payment ------------------------------
    struct Payment {
        uint256 minPrice; // s tin bid ti thiu
        uint256 lockRequired; // s tin t cc yu cu
        uint256 feeRate; // ph ngi bn phi tr: 1000 <=> 1%
        bool enable; // cho php thanh ton, v s khng xa ch update
    }
    // erc20 address => Payment
    mapping(address => Payment) public supportedPaymentMap;
    EnumerableSet.AddressSet private _paymentAddressList; // danh sch erc20 address c h tr thanh ton
    // erc20 address => total Balance ca tt c user gi vo (ngoi s ny th admin c th rt)
    mapping(address => uint256) public totalErc20OfUsers;
// end Payment ------------------------------
    
// Bid ------------------------------
    struct Bid {
        address bidder; // Bidder address
        address tokenAddress; // ERC721 address
        address paymentAddress; // ERC20 address
        uint256 tokenId; // ERC721 token id
        uint256 price; // Price for the bid in wei
        uint256 startedAt; // block.timestamp seconds
        uint256 duration; // seconds
    }
    //
    uint256 public totalBidCount; // s dng lm bidId
    // bidId => Bid
    mapping(uint256 => Bid) public bidIdToBid;
    // erc721 address => tokenId => bidId UintSet (danh sch bidIds theo tokenId)
    mapping(address => mapping(uint256 => EnumerableSet.UintSet)) private _tokenIdBidIds;
// end Bid ------------------------------
    
    
// User ------------------------------
    struct TokenLock {
        address paymentAddress; // ERC20 address
        uint256 amount; // s lng  kha
    }
    // user address => TokenLock (kha ch 1 loi token)
    mapping(address => TokenLock) public userErc20Locked;
    // user address => erc20 address => Balance amount
    mapping(address => mapping(address => uint256)) public userErc20Balance;
    // user address => bidId UintSet (danh sch bidIds theo user address)
    mapping(address => EnumerableSet.UintSet) private _userBidIds;
    // user address => erc721 address => tokenId => bidId
    mapping(address => mapping(address => mapping(uint256 => uint256))) public userBidIdByTokenId;
// end User ------------------------------

// Event ------------------------------------------------------------
    event BidCreated(address indexed bidder, uint256 id);
    event BidCancelled(address indexed bidder, uint256 id);
    // chia ra 2 event BidAccepted v BidSuccessful v event h tr ti a 3 indexed
    event BidAccepted(
        address indexed seller,
        address indexed tokenAddress,
        uint256 indexed tokenId,
        address bidder,
        address paymentAddress,
        uint256 price,
        uint256 fee
    );
    event BidSuccessful(
        address indexed bidder,
        address indexed tokenAddress,
        uint256 indexed tokenId,
        address seller,
        address paymentAddress,
        uint256 price
    );

    // User Deposit & Withdraw Erc20
    event UserDeposit(address indexed tokenAddress, address indexed from, uint256 value);
    event UserWithdraw(address indexed tokenAddress, address indexed from, address indexed to, uint256 value);
// end Event ------------------------------------------------------------
    
    
    // settings
    // 182 days - 26 weeks - 6 months
    uint256 public MAX_BID_DURATION = 365 days;
    uint256 public INCREASE_BID_RATE = 3000; // % tng so vi highBidValue: 1000 <=> 1%
    bytes4 private constant ERC721_Interface = 0x80ac58cd;

    // ----------------------------------------------------------------------------
    /* constructor() {
    } */

    // ----------------------------------------------------------------------------
    // onlyOwner Write Contract
    // ----------------------------------------------------------------------------
    // @
    function setPause(bool pause) public onlyOwner {
        pause ? _pause() : _unpause();
    }
    // @ admin settings
    function settings(uint256 maxDuration, uint256 increaseRate) external onlyOwner {
        MAX_BID_DURATION = maxDuration;
        INCREASE_BID_RATE = increaseRate;
    }
    // @ t dng nhng cn thit khi ngi khc gi trc tip ti a ch contract sau  cn rt i
    function erc721Withdraw(address tokenAddress, uint256 tokenId, address recipient) external onlyOwner {
        // require(recipient != address(0) && recipient != address(this), "E"); // tit kim gas
        IERC721(tokenAddress).transferFrom(address(this), recipient, tokenId);
    }
    // Payment ---------------------
    // @ add v update
    function addPayment(address erc20Address, uint256 minPrice, uint256 lockRequired, uint256 feeRate, bool enable, bool resetFee) external onlyOwner {
        _paymentAddressList.add(erc20Address); // khi call "add" nu  tn ti th s khng thm mi ch update Payment
        supportedPaymentMap[erc20Address] = Payment({
            minPrice: minPrice,
            lockRequired: lockRequired,
            feeRate: feeRate,
            enable: enable
        });
        // t li s tin ph thu c ca contract nu n qu ln, trng hp ny kh xy ra
        if (resetFee) userErc20Balance[address(this)][erc20Address] = 0;
    }
    /*
    // ch update khng c xa
    function removePayment(address erc20Address) external onlyOwner {
        _paymentAddressList.remove(erc20Address);
        delete supportedPaymentMap[erc20Address];
    } */
    // @
    function ownerWithdraw(address erc20Address, address recipient, uint256 amount) external onlyOwner {
        // require(recipient != address(0) && recipient != address(this), "E"); // tit kim gas
        // require(amount > 0, "E"); // tit kim gas
        uint256 total = totalErc20OfUsers[erc20Address] + amount;
        if (erc20Address == address(0)) { // native token
            if (address(this).balance >= total) payable(recipient).transfer(amount);
        } else { // erc20 token
            IERC20 erc20Contract = IERC20(erc20Address);
            if (erc20Contract.balanceOf(address(this)) >= total) erc20Contract.transfer(recipient, amount);
        }
    }
    // end Payment ---------------------
    // Bid ---------------------
