    function setErc721Support(address erc721Address, bool enable, uint256 feeRate) external onlyOwner {
        if (enable) {
            // _requireERC721(erc721Address); tit kim dung lng, nn kim tra th cng trc
            supportedErc721Map[erc721Address] = Erc721Info({
                enable: enable,
                feeRate: feeRate
            });
        } else {
            delete supportedErc721Map[erc721Address];
        }
    }
    // @
    function adminRemoveBids(uint256[] memory bidIds) external onlyOwner {
        for (uint256 i = 0; i < bidIds.length; i++) {
            Bid memory bid = bidIdToBid[bidIds[i]];
            uint256 bidId = _removeBidByBidder(bid.bidder, bid.tokenAddress, bid.tokenId);
            if (bidId > 0) emit BidCancelled(bid.bidder, bidId); // (bidder, id)
        }
    }
