    // User ---------------------
    // @
    function userDeposit(address erc20Address, uint256 amount) external payable nonReentrant whenNotPaused {
        address sender = _msgSender();
        if (msg.value > 0) _userDeposit(sender, address(0), msg.value); // deposit native token
        // Deposit song song erc20 v native token c
        if(supportedPaymentMap[erc20Address].enable && amount > 0) {
            if (IERC20(erc20Address).transferFrom(sender, address(this), amount)) {
                _userDeposit(sender, erc20Address, amount);
            }
        }
    }
    // @
    function _userDeposit(address account, address erc20Address, uint256 amount) private {
        userErc20Balance[account][erc20Address] += amount;
        totalErc20OfUsers[erc20Address] += amount;
        emit UserDeposit(erc20Address, account, amount); // emit (tokenAddress, from, value)
    }
