    // @
    function userWithdraw(address erc20Address, address recipient, uint256 amount) external nonReentrant whenNotPaused {
        // require(recipient != address(this), "E"); // tit kim gas
        address sender = _msgSender();
        uint256 userBalance = userErc20Balance[sender][erc20Address];
        require(recipient != address(0) && amount > 0 && amount <= userBalance, "E1");
        //
        uint256[] memory bidIds = _userBidIds[sender].values();
        uint256 totalBidValue = 0;
        for (uint i = 0; i < bidIds.length; i++) {
            if (bidIdToBid[bidIds[i]].paymentAddress == erc20Address) totalBidValue += bidIdToBid[bidIds[i]].price;
            if (totalBidValue > userBalance) break; // trnh trng hp user to nhiu bid v totalBidValue s b trn s
        }
        if (userBalance - amount >= totalBidValue) {
            bool success = false;
            if (erc20Address == address(0)) { // native token
                (success,  ) = payable(recipient).call{ value: amount }("");
            } else {
                success = IERC20(erc20Address).transfer(recipient, amount);
            }
            if (success) {
                userErc20Balance[sender][erc20Address] -= amount;
                totalErc20OfUsers[erc20Address] -= amount;
                emit UserWithdraw(erc20Address, sender, recipient, amount);
            }
        }
        // require(success, "E"); khng check success v d b reverted khi nhp sai amount
    }
    // @ lock v switch lock
    function lockBalance(address erc20Address) external {
        address sender = _msgSender();
        uint256 lockRequired = supportedPaymentMap[erc20Address].lockRequired;
        if (lockRequired > 0 && userErc20Balance[sender][erc20Address] >= lockRequired) {
            TokenLock storage userLocked = userErc20Locked[sender];
            if (userLocked.amount > 0) { // back to userErc20Balance
                userErc20Balance[sender][userLocked.paymentAddress] += userLocked.amount;
            }
            userErc20Balance[sender][erc20Address] -= lockRequired;
            userLocked.paymentAddress = erc20Address;
            userLocked.amount = lockRequired;
        }
    }
    // @
    function unlockBalance() external {
        address sender = _msgSender();
        uint256 totalBid = _userBidIds[sender].length();
        require(totalBid <= 1, "E2");
        TokenLock memory userLocked = userErc20Locked[sender];
        if (userLocked.amount > 0) {
            userErc20Balance[sender][userLocked.paymentAddress] += userLocked.amount;
        }
        delete userErc20Locked[sender];
    }
    // end User ---------------------
    
    // Bid ---------------------
    // @
    function placeBid(address tokenAddress, uint256 tokenId, address paymentAddress, uint256 price, uint256 duration) external nonReentrant whenNotPaused {
        address sender = _msgSender();
        require(supportedErc721Map[tokenAddress].enable, "E3"); // erc721 nay k dc ho tro
        IERC721 erc721Contract = IERC721(tokenAddress);
        address tokenOwner = erc721Contract.ownerOf(tokenId); // tokenId khng tn ti s b reverted
        // require(tokenOwner != address(0), "E"); khng cn thit
        require(tokenOwner != sender, "E4"); // The token should have an owner different from the sender
        require(duration <= MAX_BID_DURATION, "E5"); //  s khng qu ln hin th xu

        // removeBid ca bidder theo tokenId nu c, x l trc khi kim tra Payment
        _removeBidByBidder(sender, tokenAddress, tokenId);

        // Payment
        require(supportedPaymentMap[paymentAddress].enable, "E6"); // cn thit nu khng minPrice s = 0
        require(price >= supportedPaymentMap[paymentAddress].minPrice, "E7"); // Price phai >= minPrice
        // kim tra Bidder Balance
        _requireBidderBalance(sender, paymentAddress, price);

        /* x l ti client, khng kim tra nextBidRequire v tn gas
        (, uint256 nextBidRequire) = highBidByTokenId(tokenAddress, tokenId, paymentAddress);
        require(price >= nextBidRequire, "Price phai >= nextBidRequire"); */

        // start from 1, bidId bt u t 1
        totalBidCount += 1;
        uint256 bidId = totalBidCount;

        // lu bid data
        _userBidIds[sender].add(bidId);
        _tokenIdBidIds[tokenAddress][tokenId].add(bidId);
        userBidIdByTokenId[sender][tokenAddress][tokenId] = bidId;
        bidIdToBid[bidId] = Bid({
            bidder: sender,
            tokenAddress: tokenAddress,
            paymentAddress: paymentAddress,
            tokenId: tokenId,
            price: price,
            startedAt: block.timestamp,
            duration: duration
        });
        emit BidCreated(sender, bidId); // (bidder, id)
    }

    // @
    function acceptBids(uint256[] memory bidIds) external nonReentrant whenNotPaused {
        address sender = _msgSender();
        for (uint i = 0; i < bidIds.length; i++) {
            Bid memory bid = bidIdToBid[bidIds[i]];
            IERC721 erc721Contract = IERC721(bid.tokenAddress);
            address tokenOwner = erc721Contract.ownerOf(bid.tokenId);
            address approvedAddr = erc721Contract.getApproved(bid.tokenId);
            bool approvedForAll = erc721Contract.isApprovedForAll(sender, address(this));
            if (bid.price > 0 && tokenOwner == sender) {
                if (approvedForAll || approvedAddr == address(this)) _acceptBid(bid, sender);
            }
        }
    }

    // @
    function _acceptBid(Bid memory bid, address seller) private {
        // Bid memory bid = bidIdToBid[bidId];
        // kim tra bid c th accept c khng
        if (_checkValidBid(bid)) {
            _removeBidByBidder(bid.bidder, bid.tokenAddress, bid.tokenId);

            // Transfer Erc721 token to bidder, s dng transferFrom cho tit kim gas
            IERC721(bid.tokenAddress).transferFrom(seller, bid.bidder, bid.tokenId);

            // tnh ph v x l balance
            uint256 feeAmount = 0;
            uint256 feeRate = supportedErc721Map[bid.tokenAddress].feeRate;
            if (feeRate == 0) feeRate = supportedPaymentMap[bid.paymentAddress].feeRate;
            // feeRate < 10 th free, p dng cho supportedErc721Map  free cho mt erc721 no 
            if (feeRate > 9) feeAmount = bid.price*feeRate/100000;
            userErc20Balance[bid.bidder][bid.paymentAddress] -= bid.price;
            userErc20Balance[seller][bid.paymentAddress] += (bid.price - feeAmount);
            // fee ca contract thu c, lu theo a ch contract
            userErc20Balance[address(this)][bid.paymentAddress] += feeAmount;
            totalErc20OfUsers[bid.paymentAddress] -= feeAmount;

            emit BidAccepted(
                seller,             // seller
                bid.tokenAddress,   // tokenAddress
                bid.tokenId,        // tokenId
                bid.bidder,         // bidder
                bid.paymentAddress, // paymentAddress
                bid.price,          // price
                feeAmount           // fee
            );
            emit BidSuccessful(
                bid.bidder,         // bidder
                bid.tokenAddress,   // tokenAddress
                bid.tokenId,        // tokenId
                seller,             // seller
                bid.paymentAddress, // paymentAddress
                bid.price           // price
            );
        }
    }

    // @
    function cancelBids(uint256[] memory bidIds) public whenNotPaused() {
        address sender = _msgSender();
        for (uint256 i = 0; i < bidIds.length; i++) {
            Bid memory bid = bidIdToBid[bidIds[i]];
            if (sender != bid.bidder ) continue;
            uint256 bidId = _removeBidByBidder(bid.bidder, bid.tokenAddress, bid.tokenId);
            if (bidId > 0) emit BidCancelled(bid.bidder, bidId); // (bidder, id)
        }
    }
