        return _tokenIdBidIds[tokenAddress][tokenId].length();
    }
    // @
    function bidOfTokenIdByIndex(address tokenAddress, uint256 tokenId, uint256 index) public view returns (
        uint256 bidId, address bidder, address paymentAddress, uint256 price, uint256 startedAt, uint256 duration
    ) {
        bidId = _tokenIdBidIds[tokenAddress][tokenId].at(index);
        Bid memory bid = bidIdToBid[bidId];
        return (bidId, bid.bidder, bid.paymentAddress, bid.price, bid.startedAt, bid.duration); 
    }

    // @ ly highBid, nextBidRequire theo tokenId v paymentAddress
    function highBidByTokenId(address tokenAddress, uint256 tokenId, address paymentAddress) public view returns (uint256 highBid, uint256 nextBidRequire) {
        uint256[] memory bidIds = _tokenIdBidIds[tokenAddress][tokenId].values();
        highBid = 0;
        for (uint i = 0; i < bidIds.length; i++) {
            Bid memory bid = bidIdToBid[bidIds[i]];
            if (bid.paymentAddress != paymentAddress) continue;
            if (bid.price > highBid && _checkValidBid(bid)) {
                highBid = bid.price;
            }
        }
        nextBidRequire = supportedPaymentMap[paymentAddress].minPrice;
        if (highBid > 0) nextBidRequire = highBid + (highBid*INCREASE_BID_RATE/100000);
    }
    // @
    function validBidByBidIds(uint256[] memory bidIds) public view returns (bool[] memory results) {
        results = new bool[](bidIds.length);
        for (uint256 i = 0; i < bidIds.length; i++) {
            Bid memory bid = bidIdToBid[bidIds[i]];
            results[i] = _checkValidBid(bid);
        }
    }
