    // @ kim tra trc khi placeBid
    function _requireBidderBalance(address bidder, address erc20Address, uint256 price) private view {
        uint256 userBalance = userErc20Balance[bidder][erc20Address];
        uint256 totalBid = _userBidIds[bidder].length();
        require(userBalance >= price && totalBid == 0 || userErc20Locked[bidder].amount > 0, "E8"); // Insufficient funds
    }
    // @
    function _checkValidBid(Bid memory bid) private view returns (bool) {
        uint256 userBalance = userErc20Balance[bid.bidder][bid.paymentAddress];
        if ((bid.duration == 0 || bid.startedAt + bid.duration >= block.timestamp) && userBalance >= bid.price) {
            uint256 totalBid = _userBidIds[bid.bidder].length();
            // kim tra totalBid == 1 ch khng phi >= 1 v nu = 0 th bid ny khng hp l
            if (totalBid == 1 || userErc20Locked[bid.bidder].amount > 0) return true;
        }
        return false;
    }
    // @ removeBid ca bidder theo tokenId nu c
    function _removeBidByBidder(address bidder, address tokenAddress, uint256 tokenId) private returns (uint256) {
        uint256 bidId = userBidIdByTokenId[bidder][tokenAddress][tokenId];
        if (bidId > 0) {
            _userBidIds[bidder].remove(bidId);
            _tokenIdBidIds[tokenAddress][tokenId].remove(bidId);
            delete userBidIdByTokenId[bidder][tokenAddress][tokenId];
            delete bidIdToBid[bidId];
        }
        return bidId;
    }
